import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";import{o as l,c as a,e}from"./app.de8ea558.js";var t="/web_html_tester/images/levels-of-testing.png",r="/web_html_tester/images/integration-testing.png",p="/web_html_tester/images/integration-testing5.png",n="/web_html_tester/images/big-bang-method3.png",h="/web_html_tester/images/system-testing8.png",o="/web_html_tester/images/acceptance-testing3.png";const s={},d=e('<p>\u8FD9\u91CC\u7684\u6D4B\u8BD5\u81EA\u52A8\u5316\u5305\u62EC\u4E24\u4E2A\u65B9\u9762\uFF1A</p><ol><li>\u5F00\u53D1\u4EBA\u5458</li><li>QA \u4EBA\u5458</li></ol><h2 id="\u5C42\u7EA7" tabindex="-1"><a class="header-anchor" href="#\u5C42\u7EA7" aria-hidden="true">#</a> \u5C42\u7EA7</h2><p><img src="'+t+'" alt="\u6D4B\u8BD5\u5C42\u7EA7" loading="lazy"></p><ol><li>\u5355\u5143\u6D4B\u8BD5 Unit Testing</li><li>\u96C6\u6210\u6D4B\u8BD5 Integration Testing</li><li>\u7CFB\u7EDF\u6D4B\u8BD5 System Testing</li><li>\u7528\u6237\u63A5\u53D7\u6D4B\u8BD5 Acceptance Testing</li></ol><h2 id="\u5355\u5143\u6D4B\u8BD5" tabindex="-1"><a class="header-anchor" href="#\u5355\u5143\u6D4B\u8BD5" aria-hidden="true">#</a> \u5355\u5143\u6D4B\u8BD5</h2><p>\u5355\u5143\u6D4B\u8BD5\uFF08unit testing\uFF09\uFF0C\u662F\u6307\u5BF9\u8F6F\u4EF6\u4E2D\u7684\u6700\u5C0F\u53EF\u6D4B\u8BD5\u5355\u5143\u8FDB\u884C\u68C0\u67E5\u548C\u9A8C\u8BC1\u3002\u81F3\u4E8E\u201C\u5355\u5143\u201D\u7684\u5927\u5C0F\u6216\u8303\u56F4\uFF0C\u5E76\u6CA1\u6709\u4E00\u4E2A\u660E\u786E\u7684\u6807\u51C6\uFF0C\u201C\u5355\u5143\u201D\u53EF\u4EE5\u662F\u4E00\u4E2A\u51FD\u6570\u3001\u65B9\u6CD5\u3001\u7C7B\u3001\u529F\u80FD\u6A21\u5757\u6216\u8005\u5B50\u7CFB\u7EDF\u3002</p><p>\u5355\u5143\u6D4B\u8BD5\u901A\u5E38\u548C\u767D\u76D2\u6D4B\u8BD5\u8054\u7CFB\u5230\u4E00\u8D77\uFF0C\u5982\u679C\u5355\u4ECE\u6982\u5FF5\u4E0A\u6765\u8BB2\u4E24\u8005\u662F\u6709\u533A\u522B\u7684\uFF0C\u4E0D\u8FC7\u6211\u4EEC\u901A\u5E38\u6240\u8BF4\u7684\u201C\u5355\u5143\u6D4B\u8BD5\u201D\u548C\u201C\u767D\u76D2\u6D4B\u8BD5\u201D\u90FD\u8BA4\u4E3A\u662F\u548C\u4EE3\u7801\u6709\u5173\u7CFB\u7684\uFF0C\u6240\u4EE5\u5728\u67D0\u4E9B\u8BED\u5883\u4E0B\u4E5F\u901A\u5E38\u8BA4\u4E3A\u8FD9\u4E24\u8005\u662F\u540C\u4E00\u4E2A\u4E1C\u897F\u3002</p><p>\u8FD8\u6709\u4E00\u79CD\u7406\u89E3\u65B9\u5F0F\uFF0C\u5355\u5143\u6D4B\u8BD5\u548C\u767D\u76D2\u6D4B\u8BD5\u5C31\u662F\u5BF9\u5F00\u53D1\u4EBA\u5458\u6240\u7F16\u5199\u7684\u4EE3\u7801\u8FDB\u884C\u6D4B\u8BD5\uFF0C \u6982\u5FF5\u8FD9\u4E2A\u4E1C\u897F\u5927\u6982\u7406\u89E3\u662F\u4EC0\u4E48\u610F\u601D\u5373\u53EF\u3002</p><p>\u8FD9\u4E2A\u6559\u7A0B\u4E3B\u8981\u9488\u5BF9\u5F00\u53D1\u4EBA\u5458\uFF0C \u6240\u4EE5\u63D0\u524D\u900F\u9732\u4E0B\uFF0C \u4F60\u73B0\u5728\u7406\u89E3\u7684\u5355\u5143\u6D4B\u8BD5\u6CA1\u6709\u90A3\u4E48\u590D\u6742\uFF0C\u5C31\u662F\u4F60\u5E73\u65F6\u63A5\u89E6\u5230\u7684 \u6BD4\u5982java \u4E16\u754C\u91CC\u7684 Junit, mockit, powermock \u7B49\u7B49\u5DE5\u5177\u3002</p><h3 id="\u8C01\u6765\u505A" tabindex="-1"><a class="header-anchor" href="#\u8C01\u6765\u505A" aria-hidden="true">#</a> \u8C01\u6765\u505A</h3><p>\u5355\u5143\u6D4B\u8BD5\u7B80\u5355\u7406\u89E3\u5C31\u662F\u5BF9\u5F00\u53D1\u4EBA\u5458\u6240\u7F16\u5199\u7684\u4EE3\u7801\u8FDB\u884C\u6D4B\u8BD5\uFF0C\u65E2\u7136\u548C\u4EE3\u7801\u76F8\u5173\u6211\u4EEC\u7B2C\u4E00\u611F\u89C9\u90A3\u5E94\u8BE5\u662F\u201C\u5F00\u53D1\u4EBA\u5458\u6765\u505A\u201D\uFF1B</p><p>\u518D\u4E00\u770B\u5355\u5143\u6D4B\u8BD5\u5305\u542B\u201C\u6D4B\u8BD5\u201D\u4E24\u4E2A\u5B57\uFF0C\u90A3\u4E48\u201C\u6D4B\u8BD5\u4EBA\u5458\u6765\u505A\u201D\u4E5F\u5E94\u8BE5\u662F\u5408\u7406\u7684\u5427\u3002</p><p>\u5355\u5143\u6D4B\u8BD5\u4E00\u822C\u662F\u6709\u5F00\u53D1\u4EBA\u5458\u6216\u6D4B\u8BD5\u4EBA\u5458\u6765\u505A\u3002\u8C01\u6765\u505A\u5E76\u6CA1\u6709\u4E00\u4E2A\u7EDD\u5BF9\u7684\u6807\u51C6\uFF0C\u8981\u6839\u636E\u516C\u53F8\u7684\u5B9E\u9645\u60C5\u51B5\u6765\u51B3\u5B9A\u3002\u63A5\u4E0B\u6765\u6211\u4EEC\u5206\u6790\u4E00\u4E0B\u5F00\u53D1\u4EBA\u5458\u6216\u6D4B\u8BD5\u4EBA\u5458\u505A\u5355\u5143\u6D4B\u8BD5\u7684\u4F18\u7F3A\u70B9\uFF1A</p><p><strong>\u5F00\u53D1\u4EBA\u5458\u505A\u5355\u5143\u6D4B\u8BD5\uFF1A</strong></p><p><strong>\u4F18\u70B9</strong>\uFF1A\u5F00\u53D1\u4EBA\u5458\u5BF9\u4EE3\u7801\u6700\u719F\u6089\uFF0C\u800C\u4E14\u5F00\u53D1\u4EBA\u5458\u7F16\u7A0B\u6280\u80FD\u76F8\u5BF9\u6BD4\u8F83\u5F3A\uFF0C\u6240\u4EE5\u5F00\u53D1\u4EBA\u5458\u81EA\u5DF1\u5199\u5355\u5143\u6D4B\u8BD5\u6548\u7387\u4E0A\u548C\u8986\u76D6\u7387\u4E0A\u90FD\u6BD4\u8F83\u9AD8 <strong>\u7F3A\u70B9</strong>\uFF1A\u5F00\u53D1\u4EBA\u5458\u5E73\u65F6\u5199\u4E1A\u52A1\u4EE3\u7801\u5C31\u8981\u82B1\u8D39\u5F88\u591A\u65F6\u95F4\uFF0C\u6709\u65F6\u5019\u786E\u5B9E\u6CA1\u6709\u65F6\u95F4\u5199\u5355\u5143\u6D4B\u8BD5\uFF1B\u800C\u4E14\u5927\u90E8\u5206\u5F00\u53D1\u4EBA\u5458\u6CA1\u6709\u592A\u597D\u7684\u6D4B\u8BD5\u601D\u60F3\uFF0C\u5355\u5143\u6D4B\u8BD5\u53EF\u80FD\u53EA\u662F\u5199\u4E2A\u6700\u7B80\u5355\u7684\u7528\u4F8B\u5C31\u5B8C\u4E86\uFF1B\u81EA\u5DF1\u5199\u7684\u4EE3\u7801\u81EA\u5DF1\u6D4B\uFF0C\u5F80\u5F80\u90FD\u662F\u4E0D\u9760\u8C31\uFF01</p><p><strong>\u6D4B\u8BD5\u4EBA\u5458\u505A\u5355\u5143\u6D4B\u8BD5\uFF1A</strong></p><p><strong>\u4F18\u70B9</strong>\uFF1A\u6D4B\u8BD5\u4EBA\u5458\u6709\u6BD4\u8F83\u7CFB\u7EDF\u7684\u6D4B\u8BD5\u601D\u60F3\uFF0C\u53EF\u4EE5\u66F4\u597D\u5730\u4FDD\u8BC1\u7528\u4F8B\u7684\u8986\u76D6\u3002\u800C\u4E14\u901A\u8FC7\u5199\u5355\u6D4B\u6D4B\u8BD5\u80FD\u66F4\u597D\u5730\u4E86\u89E3\u5177\u4F53\u4EE3\u7801\u7ED3\u6784\u3001\u6D41\u7A0B\uFF0C\u5BF9\u4E8E\u540E\u7EED\u7684\u4E1A\u52A1\u6D4B\u8BD5\u4E5F\u975E\u5E38\u6709\u5229\u3002 <strong>\u7F3A\u70B9</strong>\uFF1A\u6D4B\u8BD5\u4EBA\u5458\u7684\u7F16\u7A0B\u6280\u80FD\u76F8\u5BF9\u6BD4\u8F83\u5F31\uFF0C\u5982\u679C\u4E0D\u540C\u7F16\u7A0B\u662F\u65E0\u6CD5\u5F00\u5C55\u5355\u5143\u6D4B\u8BD5\u7684\u3002\u5E76\u4E14\u6D4B\u8BD5\u4EBA\u5458\u5BF9\u4EE3\u7801\u6CA1\u6709\u5F00\u53D1\u4EBA\u5458\u719F\u6089\uFF0C\u6548\u7387\u4F1A\u6BD4\u8F83\u4F4E\u3002</p><h3 id="\u5982\u4F55\u505A" tabindex="-1"><a class="header-anchor" href="#\u5982\u4F55\u505A" aria-hidden="true">#</a> \u5982\u4F55\u505A</h3><p>\u5355\u5143\u6D4B\u8BD5\u7684\u5B9E\u73B0\u65B9\u5F0F\u5305\u62EC\uFF1A\u4EBA\u5DE5\u9759\u6001\u68C0\u67E5\u3001\u52A8\u6001\u6267\u884C\u8DDF\u8E2A</p><p>\u4EBA\u5DE5\u9759\u6001\u68C0\u67E5\uFF1A\u5C31\u662F\u901A\u5E38\u6240\u8BF4\u7684\u201C\u4EE3\u7801\u8D70\u8BFB\u201D\uFF0C\u4E3B\u8981\u662F\u4FDD\u8BC1\u4EE3\u7801\u903B\u8F91\u7684\u6B63\u786E\u6027 \u52A8\u6001\u6267\u884C\u8DDF\u8E2A\uFF1A\u5C31\u662F\u628A\u7A0B\u5E8F\u4EE3\u7801\u8FD0\u884C\u8D77\u6765\uFF0C\u68C0\u67E5\u5B9E\u9645\u7684\u8FD0\u884C\u7ED3\u679C\u548C\u9884\u671F\u7ED3\u679C\u662F\u5426\u4E00\u81F4</p><h4 id="\u4EBA\u5DE5\u9759\u6001\u68C0\u67E5" tabindex="-1"><a class="header-anchor" href="#\u4EBA\u5DE5\u9759\u6001\u68C0\u67E5" aria-hidden="true">#</a> \u4EBA\u5DE5\u9759\u6001\u68C0\u67E5</h4><p>\u4EBA\u5DE5\u9759\u6001\u68C0\u67E5\u5305\u542B\u7684\u4E3B\u8981\u5185\u5BB9\uFF1A</p><ol><li>\u68C0\u67E5\u7B97\u6CD5\u7684\u903B\u8F91\u6B63\u786E\u6027</li><li>\u6A21\u5757\u63A5\u53E3\u7684\u6B63\u786E\u6027\u68C0\u67E5</li><li>\u8F93\u5165\u53C2\u6570\u6709\u6CA1\u6709\u4F5C\u6B63\u786E\u6027\u68C0\u67E5</li><li>\u8C03\u7528\u5176\u4ED6\u65B9\u6CD5\u63A5\u53E3\u7684\u6B63\u786E\u6027</li><li>\u5F02\u5E38\u9519\u8BEF\u5904\u7406</li><li>\u4FDD\u8BC1\u8868\u8FBE\u5F0F\u3001SQL\u8BED\u53E5\u7684\u6B63\u786E\u6027</li><li>\u68C0\u67E5\u5E38\u91CF\u6216\u5168\u5C40\u53D8\u91CF\u4F7F\u7528\u7684\u6B63\u786E\u6027</li><li>\u7A0B\u5E8F\u98CE\u683C\u7684\u4E00\u81F4\u6027\u3001\u89C4\u8303\u6027</li><li>\u68C0\u67E5\u4EE3\u7801\u6CE8\u91CA\u662F\u5426\u5B8C\u6574</li></ol><h4 id="\u52A8\u6001\u6267\u884C\u8DDF\u8E2A" tabindex="-1"><a class="header-anchor" href="#\u52A8\u6001\u6267\u884C\u8DDF\u8E2A" aria-hidden="true">#</a> \u52A8\u6001\u6267\u884C\u8DDF\u8E2A</h4><p>\u52A8\u6001\u6267\u884C\u8DDF\u8E2A\u9700\u8981\u7F16\u5199\u6D4B\u8BD5\u811A\u672C\u8C03\u7528\u4E1A\u52A1\u4EE3\u7801\u8FDB\u884C\u6D4B\u8BD5\uFF0C\u4E3A\u4E86\u66F4\u597D\u7684\u7BA1\u7406\u7EF4\u62A4\u6D4B\u8BD5\u811A\u672C\uFF0C\u4E00\u822C\u4F1A\u91C7\u7528\u5355\u5143\u6D4B\u8BD5\u6846\u67B6\u6765\u7BA1\u7406\uFF0C\u4E0D\u540C\u7684\u8BED\u8A00\u6709\u4E0D\u540C\u7684\u5355\u5143\u6D4B\u8BD5\u6846\u67B6\uFF1A</p><ol><li>Java\uFF1A<code>JUnit</code>\u3001TestNG</li><li>Python\uFF1AUintTest\u3001pyTest</li></ol><p>\u5355\u5143\u6D4B\u8BD5\u7684\u4E00\u4E2A\u91CD\u8981\u7684\u8861\u91CF\u6807\u51C6\u5C31\u662F\u4EE3\u7801\u8986\u76D6\u7387\uFF0C\u5C3D\u91CF\u505A\u5230\u4EE3\u7801\u7684\u5168\u8986\u76D6\u3002\u5E38\u89C1\u5355\u5143\u6D4B\u8BD5\u8986\u76D6\u6807\u51C6\uFF1A</p><ol><li>\u8BED\u53E5\u8986\u76D6</li><li>\u5206\u652F\u8986\u76D6</li><li>\u6761\u4EF6\u8986\u76D6</li><li>\u5206\u652F-\u6761\u4EF6\u8986\u76D6</li><li>\u6761\u4EF6\u7EC4\u5408\u8986\u76D6</li><li>\u8DEF\u5F84\u8986\u76D6</li></ol><h2 id="\u96C6\u6210\u6D4B\u8BD5" tabindex="-1"><a class="header-anchor" href="#\u96C6\u6210\u6D4B\u8BD5" aria-hidden="true">#</a> \u96C6\u6210\u6D4B\u8BD5</h2><p>\u96C6\u6210\u6D4B\u8BD5\uFF0C\u4E5F\u53EB\u7EC4\u88C5\u6D4B\u8BD5\u6216\u8054\u5408\u6D4B\u8BD5\u3002\u5728\u5355\u5143\u6D4B\u8BD5\u7684\u57FA\u7840\u4E0A\uFF0C\u5C06\u6240\u6709\u6A21\u5757\u6309\u7167\u8BBE\u8BA1\u8981\u6C42\uFF08\u5982\u6839\u636E\u7ED3\u6784\u56FE\uFF09\u7EC4\u88C5\u6210\u4E3A\u5B50\u7CFB\u7EDF\u6216\u7CFB\u7EDF\uFF0C\u8FDB\u884C\u96C6\u6210\u6D4B\u8BD5\u3002</p><p><img src="'+r+'" alt="\u96C6\u6210\u6D4B\u8BD5" loading="lazy"></p><p>\u96C6\u6210\u6D4B\u8BD5\u4E3B\u8981\u76EE\u7684\u662F\u6D4B\u8BD5\u6A21\u5757\u4E4B\u95F4\u7684\u63A5\u53E3\u3002 \u7531\u4E8E\u591A\u79CD\u539F\u56E0\uFF0C\u4EC5\u5355\u5143\u6D4B\u8BD5\u662F\u4E0D\u591F\u7684\uFF0C\u4F8B\u5982\uFF1A</p><ol><li>\u6A21\u5757/\u5355\u5143\u901A\u5E38\u7531\u5355\u72EC\u7684\u8F6F\u4EF6\u5F00\u53D1\u4EBA\u5458\u8BBE\u8BA1\uFF0C\u5176\u6280\u672F\u548C\u7F16\u7A0B\u903B\u8F91\u4E0E\u5176\u4ED6\u7A0B\u5E8F\u5458\u4E0D\u540C</li><li>\u901A\u5E38\u5728\u6A21\u5757\u5F00\u53D1\u65F6\uFF0C\u7528\u6237\u9700\u6C42\u4F1A\u53D1\u751F\u53D8\u5316\uFF0C\u5E76\u4E14\u8FD9\u4E9B\u65B0\u9700\u6C42\u53EF\u80FD\u672A\u7ECF\u8FC7\u5355\u5143\u6D4B\u8BD5\u3002\u8FD9\u5F15\u53D1\u4E86\u95EE\u9898</li><li>\u5728\u5355\u5143\u6D4B\u8BD5\u671F\u95F4\uFF0C\u6709\u65F6\u4F1A\u9057\u6F0F\u8BF8\u5982\u6570\u636E\u683C\u5F0F\uFF0C\u9519\u8BEF\u9677\u9631\uFF0C\u786C\u4EF6\u63A5\u53E3\u548C\u7B2C\u4E09\u65B9\u670D\u52A1\u63A5\u53E3\u4E4B\u7C7B\u7684\u95EE\u9898</li></ol><p>\u56E0\u6B64\uFF0C\u65E0\u8BBA\u6BCF\u4E2A\u6A21\u5757/\u5355\u5143\u7684\u8FD0\u884C\u6548\u7387\u5982\u4F55\uFF0C\u5982\u679C\u5B83\u4EEC\u672A\u6B63\u786E\u96C6\u6210\uFF0C\u90FD\u4F1A\u5F71\u54CD\u8F6F\u4EF6\u7A0B\u5E8F\u7684\u529F\u80FD\u3002</p><p>\u96C6\u6210\u6D4B\u8BD5\u76EE\u7684\uFF1A</p><ol><li>\u786E\u4FDD\u96C6\u6210\u6A21\u5757\u6309\u9884\u671F\u6B63\u5E38\u5DE5\u4F5C</li><li>\u5B83\u68C0\u6D4B\u4E0E\u6A21\u5757\u4E4B\u95F4\u7684\u63A5\u53E3\u6709\u5173\u7684\u9519\u8BEF</li><li>\u5E2E\u52A9\u6A21\u5757\u4E0EAPI\u548C\u5176\u4ED6\u7B2C\u4E09\u65B9\u5DE5\u5177\u8FDB\u884C\u4EA4\u4E92</li><li>\u901A\u5E38\u8986\u76D6\u5927\u91CF\u7CFB\u7EDF\uFF0C\u56E0\u6B64\u6548\u7387\u66F4\u9AD8</li><li>\u589E\u52A0\u6D4B\u8BD5\u8303\u56F4\u5E76\u63D0\u9AD8\u6D4B\u8BD5\u7684\u53EF\u9760\u6027</li></ol><h3 id="\u5982\u4F55\u505A\u96C6\u6210\u6D4B\u8BD5" tabindex="-1"><a class="header-anchor" href="#\u5982\u4F55\u505A\u96C6\u6210\u6D4B\u8BD5" aria-hidden="true">#</a> \u5982\u4F55\u505A\u96C6\u6210\u6D4B\u8BD5</h3><p>\u96C6\u6210\u7684\u542B\u4E49\u975E\u5E38\u7B80\u5355\u2013\u5C06\u7ECF\u8FC7\u5355\u5143\u6D4B\u8BD5\u7684\u6A21\u5757\u4E00\u4E2A\u63A5\u4E00\u4E2A\u5730\u7EC4\u5408\uFF0C\u7136\u540E\u6D4B\u8BD5\u7EC4\u5408\u5355\u5143\u7684\u529F\u80FD\u3002</p><p>\u901A\u5E38\uFF0C\u96C6\u6210\u6D4B\u8BD5\u662F\u5728\u5355\u5143\u6D4B\u8BD5\u4E4B\u540E\u8FDB\u884C\u7684\u3002\u4E00\u65E6\u521B\u5EFA\u5E76\u6D4B\u8BD5\u4E86\u6240\u6709\u5355\u4E2A\u5355\u5143\uFF0C\u6211\u4EEC\u4FBF\u5F00\u59CB\u7EC4\u5408\u90A3\u4E9B\u7ECF\u8FC7\u6D4B\u8BD5\u7684\u6A21\u5757\u5E76\u5F00\u59CB\u6267\u884C\u96C6\u6210\u6D4B\u8BD5\uFF1A</p><ol><li>\u51C6\u5907\u6D4B\u8BD5\u6574\u5408\u8BA1\u5212</li><li>\u786E\u5B9A\u96C6\u6210\u6D4B\u8BD5\u65B9\u6CD5\u7684\u7C7B\u578B</li><li>\u76F8\u5E94\u5730\u8BBE\u8BA1\u6D4B\u8BD5\u7528\u4F8B\uFF0C\u6D4B\u8BD5\u573A\u666F\u548C\u6D4B\u8BD5\u811A\u672C</li><li>\u4E00\u8D77\u90E8\u7F72\u6240\u9009\u6A21\u5757\u5E76\u8FD0\u884C\u96C6\u6210\u6D4B\u8BD5</li><li>\u8DDF\u8E2A\u7F3A\u9677\u5E76\u8BB0\u5F55\u6D4B\u8BD5\u7ED3\u679C</li><li>\u91CD\u590D\u4E0A\u8FF0\u6B65\u9AA4\uFF0C\u76F4\u5230\u6D4B\u8BD5\u5B8C\u6574\u4E2A\u7CFB\u7EDF</li></ol><h3 id="\u96C6\u6210\u6D4B\u8BD5\u7684\u65B9\u6CD5" tabindex="-1"><a class="header-anchor" href="#\u96C6\u6210\u6D4B\u8BD5\u7684\u65B9\u6CD5" aria-hidden="true">#</a> \u96C6\u6210\u6D4B\u8BD5\u7684\u65B9\u6CD5</h3><p><img src="'+p+'" alt="\u96C6\u6210\u6D4B\u8BD5\u65B9\u6CD5\u8BBA" loading="lazy"></p><h3 id="\u5168\u91CF\u6574\u5408\u6D4B\u8BD5" tabindex="-1"><a class="header-anchor" href="#\u5168\u91CF\u6574\u5408\u6D4B\u8BD5" aria-hidden="true">#</a> \u5168\u91CF\u6574\u5408\u6D4B\u8BD5</h3><p><img src="'+n+'" alt="big bang" loading="lazy"></p><p>\u5728\u8FD9\u79CD\u6D4B\u8BD5\u65B9\u6CD5\u4E2D\uFF0C\u4E00\u65E6\u6240\u6709\u6A21\u5757\u5206\u522B\u5F00\u53D1\u548C\u6D4B\u8BD5\uFF0C\u5B83\u4EEC\u5C06\u88AB\u96C6\u6210\u4E00\u6B21\u5E76\u7ACB\u5373\u4E00\u8D77\u6D4B\u8BD5\u3002\u8FD9\u79CD\u6D4B\u8BD5\u7684\u552F\u4E00\u4F18\u70B9\u662F\uFF0C\u5B83\u975E\u5E38\u9002\u5408\u4E8E\u8F83\u5C0F\u7684\u7CFB\u7EDF\u3002</p><p>\u7F3A\u70B9</p><ol><li>\u6545\u969C\u5B9A\u4F4D\u5F88\u56F0\u96BE</li><li>\u6D4B\u8BD5\u4E4B\u524D\u6709\u5F88\u591A\u5EF6\u8FDF</li><li>\u5173\u952E\u95EE\u9898\u6CA1\u6709\u5F97\u5230\u4F18\u5148\u89E3\u51B3</li><li>\u5F88\u96BE\u627E\u5230\u95EE\u9898\u7684\u6839\u672C\u539F\u56E0</li></ol><h3 id="\u589E\u91CF\u96C6\u6210\u6D4B\u8BD5" tabindex="-1"><a class="header-anchor" href="#\u589E\u91CF\u96C6\u6210\u6D4B\u8BD5" aria-hidden="true">#</a> \u589E\u91CF\u96C6\u6210\u6D4B\u8BD5</h3><p>\u901A\u8FC7\u5C06\u903B\u8F91\u4E0A\u76F8\u5173\u7684\u4E24\u4E2A\u6216\u66F4\u591A\u6A21\u5757\u8FDE\u63A5\u5728\u4E00\u8D77\u6765\u6267\u884C\u589E\u91CF\u6D4B\u8BD5\u3002</p><p>\u540E\u6765\u53C8\u6DFB\u52A0\u4E86\u66F4\u591A\u6A21\u5757\uFF0C\u5E76\u5BF9\u5176\u529F\u80FD\u8FDB\u884C\u4E86\u6D4B\u8BD5\u3002\u76F4\u5230\u5B8C\u6210\u6240\u6709\u6A21\u5757\u7684\u96C6\u6210\u5E76\u6210\u529F\u6D4B\u8BD5\u4E3A\u6B62\u3002</p><p>\u5B83\u53C8\u5206\u4E3A\u81EA\u4E0A\u800C\u4E0B\u65B9\u6CD5\uFF0C\u81EA\u4E0B\u800C\u4E0A\u65B9\u6CD5\u3002</p><h4 id="\u81EA\u4E0A\u800C\u4E0B\u7684\u96C6\u6210\u6D4B\u8BD5" tabindex="-1"><a class="header-anchor" href="#\u81EA\u4E0A\u800C\u4E0B\u7684\u96C6\u6210\u6D4B\u8BD5" aria-hidden="true">#</a> \u81EA\u4E0A\u800C\u4E0B\u7684\u96C6\u6210\u6D4B\u8BD5</h4><p>\u81EA\u4E0A\u800C\u4E0B\u7684\u65B9\u6CD5\u4ECE\u6D4B\u8BD5\u6700\u9876\u5C42\u7684\u6A21\u5757\u5F00\u59CB\uFF0C\u7136\u540E\u9010\u6B65\u5730\u9010\u6B65\u964D\u5230\u6700\u4F4E\u7684\u4E00\u7EC4\u6A21\u5757\u3002</p><p>\u6D4B\u8BD5\u6309\u7167\u8F6F\u4EF6\u7CFB\u7EDF\u7684\u63A7\u5236\u6D41\u7A0B\u4ECE\u4E0A\u5230\u4E0B\u8FDB\u884C\u3002\u7531\u4E8E\u5728\u6D4B\u8BD5\u9876\u5C42\u6A21\u5757\u65F6\u6709\u53EF\u80FD\u672A\u5F00\u53D1\u51FA\u8F83\u4F4E\u7EA7\u522B\u7684\u6A21\u5757\uFF0C\u56E0\u6B64\u6211\u4EEC\u4F7F\u7528\u5B58\u6839\u800C\u4E0D\u662F\u90A3\u4E9B\u5C1A\u672A\u5C31\u7EEA\u7684\u6A21\u5757\u3002</p><p>\u5BF9\u4E8E\u7B80\u5355\u7684\u5E94\u7528\u7A0B\u5E8F\uFF0C\u5B58\u6839\u5C06\u7B80\u5355\u5730\u5C06\u63A7\u4EF6\u8FD4\u56DE\u5176\u4E0A\u7EA7\u6A21\u5757\u3002\u5BF9\u4E8E\u590D\u6742\u7684\u5E94\u7528\u7A0B\u5E8F\uFF0C\u4ED6\u4EEC\u5C06\u6A21\u62DF\u6574\u4E2A\u54CD\u5E94\u8303\u56F4\u3002</p><p>\u4F18\u70B9</p><ol><li>\u6545\u969C\u5B9A\u4F4D\u66F4\u5BB9\u6613</li><li>\u6D4B\u8BD5\u4EA7\u54C1\u6781\u4E3A\u4E00\u81F4</li><li>\u4E0E\u9A71\u52A8\u7A0B\u5E8F\u76F8\u6BD4\uFF0C\u53EF\u4EE5\u4EE5\u66F4\u5C11\u7684\u65F6\u95F4\u5199\u5B58\u6839</li><li>\u5173\u952E\u6A21\u5757\u7ECF\u8FC7\u4F18\u5148\u7EA7\u6D4B\u8BD5</li><li>\u5C3D\u65E9\u53D1\u73B0\u4E3B\u8981\u8BBE\u8BA1\u7F3A\u9677</li></ol><p>\u7F3A\u70B9</p><ol><li>\u9700\u8981\u51E0\u4E2A\u5B58\u6839</li><li>\u5BF9\u65E9\u671F\u53D1\u5E03\u7684\u652F\u6301\u4E0D\u4F73</li><li>\u5728\u5468\u671F\u7ED3\u675F\u65F6\u6D4B\u8BD5\u57FA\u672C\u529F\u80FD</li></ol><h4 id="\u81EA\u4E0B\u800C\u4E0A\u7684\u96C6\u6210\u6D4B\u8BD5" tabindex="-1"><a class="header-anchor" href="#\u81EA\u4E0B\u800C\u4E0A\u7684\u96C6\u6210\u6D4B\u8BD5" aria-hidden="true">#</a> \u81EA\u4E0B\u800C\u4E0A\u7684\u96C6\u6210\u6D4B\u8BD5</h4><p>\u81EA\u4E0B\u800C\u4E0A\u7684\u65B9\u6CD5\u4ECE\u6D4B\u8BD5\u5E94\u7528\u7A0B\u5E8F\u7684\u6700\u4F4E\u5355\u5143\u5F00\u59CB\uFF0C\u7136\u540E\u9010\u6B65\u5730\u9010\u6B65\u8FDB\u884C\u3002</p><p>\u4ECE\u63A7\u5236\u6D41\u7684\u5E95\u90E8\u5230\u5411\u4E0A\u8FDB\u884C\u6D4B\u8BD5\u3002\u540C\u6837\uFF0C\u5728\u6D4B\u8BD5\u8F83\u4F4E\u7684\u6A21\u5757\u65F6\uFF0C\u53EF\u80FD\u5C1A\u672A\u5F00\u53D1\u51FA\u8F83\u9AD8\u7EA7\u522B\u7684\u6A21\u5757\u3002</p><p>\u5728\u8FD9\u79CD\u60C5\u51B5\u4E0B\uFF0C\u6211\u4EEC\u901A\u8FC7\u4F7F\u7528\u9A71\u52A8\u7A0B\u5E8F\u6765\u6A21\u62DF\u7F3A\u5C11\u7684\u6A21\u5757\u7684\u529F\u80FD\u3002\u8FD9\u4E9B\u9A71\u52A8\u7A0B\u5E8F\u6267\u884C\u4E00\u7CFB\u5217\u4EFB\u52A1\uFF0C\u4F8B\u5982\u8C03\u7528\u88AB\u6D4B\u6A21\u5757\uFF0C\u4F20\u9012\u6D4B\u8BD5\u6570\u636E\u6216\u63A5\u6536\u8F93\u51FA\u6570\u636E\u3002</p><p>\u4F18\u70B9</p><ol><li>\u5728\u8FD9\u91CC\uFF0C\u5F00\u53D1\u548C\u6D4B\u8BD5\u53EF\u4EE5\u4E00\u8D77\u5B8C\u6210\uFF0C\u4ECE\u800C\u4F7F\u4EA7\u54C1\u9AD8\u6548</li><li>\u6D4B\u8BD5\u6761\u4EF6\u5F88\u5BB9\u6613\u521B\u5EFA</li></ol><p>\u7F3A\u70B9</p><ol><li>\u9700\u8981\u51E0\u4E2A\u9A71\u52A8\u7A0B\u5E8F</li><li>\u6570\u636E\u6D41\u6D4B\u8BD5\u5F88\u665A</li><li>\u9700\u8981\u9A71\u52A8\u7A0B\u5E8F\u4F7F\u6D4B\u8BD5\u6570\u636E\u7BA1\u7406\u53D8\u5F97\u590D\u6742</li><li>\u5BF9\u65E9\u671F\u53D1\u5E03\u7684\u652F\u6301\u4E0D\u4F73</li><li>\u5173\u952E\u63A5\u53E3\u7F3A\u9677\u53D1\u73B0\u8F83\u665A</li></ol><h2 id="\u7CFB\u7EDF\u6D4B\u8BD5" tabindex="-1"><a class="header-anchor" href="#\u7CFB\u7EDF\u6D4B\u8BD5" aria-hidden="true">#</a> \u7CFB\u7EDF\u6D4B\u8BD5</h2><p>\u7CFB\u7EDF\u6D4B\u8BD5\u5305\u62EC\u6D4B\u8BD5\u5B8C\u5168\u96C6\u6210\u7684\u8F6F\u4EF6\u7CFB\u7EDF\u3002\u901A\u5E38\uFF0C\u8BA1\u7B97\u673A\u7CFB\u7EDF\u662F\u901A\u8FC7\u8F6F\u4EF6\u96C6\u6210\u5236\u6210\u7684\u3002</p><p>\u6362\u53E5\u8BDD\u8BF4\uFF0C\u4E00\u7EC4\u8F6F\u4EF6\u7684\u8BA1\u7B97\u673A\u7CFB\u7EDF\u6267\u884C\u5404\u79CD\u4EFB\u52A1\uFF0C\u4F46\u53EA\u6709\u8F6F\u4EF6\u624D\u80FD\u6267\u884C\u4EFB\u52A1; \u8F6F\u4EF6\u5FC5\u987B\u4E0E\u517C\u5BB9\u7684\u786C\u4EF6\u63A5\u53E3\u3002</p><p>\u7CFB\u7EDF\u6D4B\u8BD5\u662F\u4E00\u7CFB\u5217\u4E0D\u540C\u7C7B\u578B\u7684\u6709\u76EE\u7684\u7684\u6D4B\u8BD5\u884C\u4F7F\u548C\u5BA1\u67E5\u9488\u5BF9\u9700\u6C42\u7684\u96C6\u6210\u8F6F\u4EF6\u7684\u8BA1\u7B97\u673A\u7CFB\u7EDF\u7684\u5168\u90E8\u5DE5\u4F5C\u3002</p><ol><li>\u6D4B\u8BD5\u5305\u62EC\u5916\u90E8\u5916\u56F4\u8BBE\u5907\u5728\u5185\u7684\u5B8C\u5168\u96C6\u6210\u7684\u5E94\u7528\u7A0B\u5E8F\uFF0C\u4EE5\u68C0\u67E5\u7EC4\u4EF6\u4E4B\u95F4\u4EE5\u53CA\u6574\u4E2A\u7CFB\u7EDF\u4E4B\u95F4\u5982\u4F55\u4EA4\u4E92\u3002\u8FD9\u4E5F\u79F0\u4E3A<strong>\u7AEF\u5230\u7AEF\u6D4B\u8BD5</strong>\u65B9\u6848\u3002</li><li>\u9A8C\u8BC1\u5BF9\u5E94\u7528\u7A0B\u5E8F\u4E2D\u6BCF\u4E2A\u8F93\u5165\u7684\u5168\u9762\u6D4B\u8BD5\uFF0C\u4EE5\u68C0\u67E5\u6240\u9700\u7684\u8F93\u51FA\u3002</li><li>\u6D4B\u8BD5\u7528\u6237\u5BF9\u5E94\u7528\u7A0B\u5E8F\u7684\u4F53\u9A8C\u3002</li></ol><p><img src="'+h+'" alt="System testing role" loading="lazy"></p><h2 id="uat-\u6D4B\u8BD5" tabindex="-1"><a class="header-anchor" href="#uat-\u6D4B\u8BD5" aria-hidden="true">#</a> UAT \u6D4B\u8BD5</h2><p>UAT\uFF0C(User Acceptance Test),\u4E5F\u5C31\u662F\u7528\u6237\u9A8C\u6536\u6D4B\u8BD5\uFF0C\u6216\u7528\u6237\u53EF\u63A5\u53D7\u6D4B\u8BD5,\u8FD9\u65F6\u76F8\u5173\u7684\u7528\u6237\u6216\u72EC\u7ACB\u6D4B\u8BD5\u4EBA\u5458\u6839\u636E\u6D4B\u8BD5\u8BA1\u5212\u548C\u7ED3\u679C\u5BF9\u7CFB\u7EDF\u8FDB\u884C\u6D4B\u8BD5\u548C\u63A5\u6536\u3002</p><p>\u5728\u4EA7\u54C1\u4E0A\u7EBF\u524D\uFF0C\u6211\u4EEC\u9700\u8981\u5BF9\u6574\u4E2A\u9879\u76EE\u6BCF\u4E2A\u7EC6\u8282\u529F\u80FD\u90FD\u6D4B\u8BD5\u4E00\u904D\uFF0C\u4EE5\u786E\u8BA4\u529F\u80FD\u6CA1\u6709\u95EE\u9898\u7684\u524D\u63D0\u4E0B\uFF0C\u624D\u80FD\u4E0A\u7EBF\u63A8\u51FA\u5E02\u573A\u7ED9\u771F\u6B63\u7684\u7528\u6237\u4F7F\u7528\uFF1B</p><p>\u8FD9\u4E2A\u8FC7\u7A0B\uFF0C\u4E5F\u662F\u4EA7\u54C1\u4E0A\u7EBF\u524D\u7684\u5FC5\u7ECF\u9636\u6BB5\uFF0C\u5C11\u4E86\u8FD9\u4E2A\u73AF\u8282\uFF0C\u53EF\u80FD\u4F1A\u53D1\u73B0\u4E0A\u7EBF\u540E\u9762\u4E34\u6025\u9700\u4FEE\u590D\u6216\u8005\u5F71\u54CD\u7528\u6237\u7684\u4F53\u9A8C\u7684\u95EE\u9898\u3002</p><p>\u7CFB\u7EDF\u6D4B\u8BD5\u548CUAT\u6D4B\u8BD5\u7684\u5DEE\u522B\uFF1F</p><ol><li>\u7CFB\u7EDF\u6D4B\u8BD5\uFF1A\u7CFB\u7EDF\u6D4B\u8BD5\u662F\u5728\u7CFB\u7EDF\u672A\u4EA4\u4ED8\u4F7F\u7528\u5236\u4F5C\u65B9\u81EA\u884C\u8FDB\u884C\u7684\u6D4B\u8BD5\uFF0C\u65E0\u7528\u6237\u53C2\u4E0E\u3002\u53EA\u6709\u672C\u65B9\u7528\u6237\u53C2\u4E0E\u3002</li><li>UAT\u6D4B\u8BD5\uFF1A\u662F\u672C\u65B9\u4EBA\u5458\u548C\u7528\u6237\u65B9\u4E00\u8D77\u5B9E\u884C\u7684\u6D4B\u8BD5\u3002</li></ol><p><img src="'+o+'" alt="UAT testing" loading="lazy"></p><h3 id="\u6B65\u9AA4\u7F16\u8F91" tabindex="-1"><a class="header-anchor" href="#\u6B65\u9AA4\u7F16\u8F91" aria-hidden="true">#</a> \u6B65\u9AA4\u7F16\u8F91</h3><blockquote><p>\u767E\u5EA6\u767E\u79D1\uFF0C \u6BD4\u8F83\u5168\u9762</p></blockquote><ol><li>\u7528\u6237\u57F9\u8BAD\u624B\u518C\u51C6\u5907\uFF08\u5C31\u662F\u9488\u5BF9\u8981\u8FDB\u884CUAT\u6D4B\u8BD5\u7684\u5BF9\u8C61\uFF0C\u53CA\u8981\u8FDB\u884C\u57F9\u8BAD\u7684\u7528\u6237\uFF0C\u51C6\u5907\u4E00\u4E9B\u57F9\u8BAD\u8D44\u6599\uFF1A\u4E00\u822C\u662F\u6D4B\u8BD5\u5BF9\u8C61\u4F7F\u7528/\u529F\u80FD\u624B\u518C\u53CA\u8981\u57F9\u8BAD\u7684\u7528\u6237\u7684\u4E2A\u4EBA\u8D44\u6599\u7B49\u7B49\uFF1A\u5C31\u8DDF\u6559\u5E08\u4E0A\u8BFE\u8FDB\u884C\u5907\u8BFE\u5DEE\u4E0D\u591A\uFF09</li><li>\u6D4B\u8BD5\u811A\u672C\u53D1\u653E\uFF08\u5982\u679C\u4F60\u516C\u53F8\u91C7\u7528\u81EA\u52A8\u5316\u6D4B\u8BD5\uFF0C\u90A3\u4E48\u6BCF\u4E00\u4E2A\u529F\u80FD\u6216\u4E00\u4E2A\u6A21\u5757\u7B49\u90FD\u6709\u5BF9\u5E94\u7684\u6D4B\u8BD5\u811A\u672C\uFF0C\u53EF\u4EE5\u628A\u8FD9\u4E9B\u6D4B\u8BD5\u811A\u672C\u5206\u53D1\u7ED9\u7279\u5B9A\u7684\u4EBA\u5458\uFF1B\u5982\u679C\u91C7\u7528\u624B\u5DE5\u6D4B\u8BD5\uFF0C\u5C31\u8981\u628A\u8BE6\u7EC6\u63CF\u8FF0\u4E00\u4E2A\u529F\u80FD\u6216\u6A21\u5757\u7684\u6587\u6863\u5206\u7ED9\u76F8\u5173\u4EBA\u5458\uFF08\u5F53\u7136\u81EA\u52A8\u5316\u6D4B\u8BD5\u4E5F\u8981\u5206\u53D1\uFF09</li><li>\u7528\u6237\u8865\u5145\u4E1A\u52A1\u6D4B\u8BD5\u573A\u666F\u548C\u6D4B\u8BD5\u6570\u636E\uFF08\u5C31\u662F\uFF1A\u8BF7\u6709\u4EE3\u8868\u6027\u7684\u4E00\u4E9B\u6700\u7EC8\u7528\u6237\u6839\u636E\u5B9E\u9645\u5E94\u7528\u73AF\u5883\u53CA\u4E00\u4E9B\u5E38\u7528\u5904\u7406\u7684\u6570\u636E\uFF0C\u6765\u7ED9\u4E00\u4E9B\u8865\u5145\u4E0E\u5EFA\u8BAE\uFF0C\u8D8A\u8D34\u8FD1\u5B9E\u9645\u5E94\u7528\u8D8A\u597D\uFF09</li><li>\u987E\u95EE\u8865\u5145\u6D4B\u8BD5\u6B65\u9AA4\uFF08\u4F60\u53EF\u4EE5\u8BF7\u9879\u76EE\u4E13\u5BB6\uFF0C\u6D4B\u8BD5\u7ECF\u7406\uFF0C\u6216\u4E13\u95E8\u7684\u6D4B\u8BD5\uFF0C\u5F00\u53D1\u7B49\u987E\u95EE\u5BF9\u6D4B\u8BD5\u6B65\u9AA4\u8FDB\u884C\u8865\u5145\uFF09</li><li>\u57F9\u8BAD\u8D44\u6599\u53CA\u6D4B\u8BD5\u811A\u672C\u6587\u6863\u7684\u786E\u5B9A\u4E0E\u6700\u7EC8\u8F93\u51FA(\u4E00\u822C\u5230\u6B64\uFF0C\u5404\u79CD\u8D44\u6599\u90FD\u57FA\u672C\u786E\u5B9A\uFF0C\u8FD9\u65F6\u53EF\u4EE5\u5C06\u5B83\u4EEC\u8FDB\u884C\u6253\u5370\uFF0C\u6216\u5F62\u6210\u7279\u522B\u7684\u7535\u5B50\u6587\u6863\uFF09</li><li>\u6D4B\u8BD5\u7B56\u7565\u7684\u5236\u5B9A</li><li>\u6D4B\u8BD5\u7528\u6237\u7684\u786E\u5B9A\uFF08\u5927\u4F53\u4E0A\u4ECE\u57F9\u8BAD\u4EBA\u5458\u4E2D\u9009\u53D6\uFF0C\u56E0\u4E3A\u4E0D\u662F\u6BCF\u4E2A\u63A5\u53D7\u57F9\u8BAD\u7684\u4EBA\u5458\u90FD\u80FD\u6709\u8D44\u683C\u53BB\u6D4B\u8BD5\u7684\uFF0C\u8FD9\u91CC\u4F60\u53EF\u4EE5\u901A\u8FC7\u4E00\u4E9B\u8003\u6838\u6765\u5B9E\u73B0\u4EBA\u5458\u7684\u7B5B\u9009\u7B49\u7B49\uFF09</li><li>\u7531\u4E13\u95E8\u7684\u6D4B\u8BD5\u7EC4\u7EC7\u673A\u6784\u786E\u5B9A\u6D4B\u8BD5\u5730\u70B9\uFF0C\u5E76\u53D1\u51FA\u901A\u77E5</li><li>\u6D4B\u8BD5\u7F51\u7EDC\u73AF\u5883\u7684\u642D\u5EFA\u548C\u4FDD\u969C\uFF08\u5305\u62EC\u7F51\u7EDC\uFF0C\u7CFB\u7EDF\uFF0C\u786C\u8F6F\u4EF6\uFF0C\u5305\u62EC\u4E00\u4E9Bcase\u5DE5\u5177\u7B49\uFF09</li><li>\u7EC4\u7EC7\u8FDB\u884C\u6D4B\u8BD5</li><li>\u8BC4\u5BA1\u5206\u6790\u63D0\u4EA4\u7684\u95EE\u9898\uFF08\u8FD9\u5C31\u8FDB\u5165\u4E86\u4E00\u822Cbug\u5904\u7406\u8FC7\u7A0B\uFF0C\u5F62\u6210\u4E86\u4E00\u4E2A\u5FAA\u73AF\uFF09</li></ol><h3 id="\u6210\u529F\u5173\u952E" tabindex="-1"><a class="header-anchor" href="#\u6210\u529F\u5173\u952E" aria-hidden="true">#</a> \u6210\u529F\u5173\u952E</h3><ol><li>\u57F9\u8BAD\u7684\u8D44\u6599\u8868\u8FF0\u8981\u51C6\u786E\u5168\u9762\uFF0C\u6613\u61C2\u7B49\uFF08\u8FD9\u662F\u7406\u8BBA\u57FA\u7840\uFF09</li><li>\u4EBA\u5458\u9009\u62E9\uFF0C\u8981\u5178\u578B\u6709\u4EE3\u8868\u6027\uFF08\u7528\u6237\u57FA\u7840\uFF09</li><li>\u6D4B\u8BD5\u6D41\u7A0B\u6B65\u9AA4\uFF08\u8981\u5468\u5BC6\uFF09</li><li>\u6D4B\u8BD5\u7B56\u7565\u5236\u5B9A\uFF08\u786E\u5B9A\u4E00\u4E2A\u9002\u5408\u6D4B\u8BD5\u5BF9\u8C61\u53CA\u6D4B\u8BD5\u4EBA\u5458\u7684\u6D4B\u8BD5\u7B56\u7565\uFF09</li><li>\u95EE\u9898\u7684\u8868\u8FBE\u4E0E\u5904\u7406(\u56E0\u4E3A\u6D4B\u8BD5\u8005\u4E0D\u662F\u4E13\u4E1A\u5F00\u53D1\u6D4B\u8BD5\u4EBA\u5458\uFF0C\u5BF9\u4E8E\u95EE\u9898\u7684\u8868\u8FBE\u53EF\u80FD\u4E0D\u80FD\u5230\u4F4D\uFF0C\u6216\u6839\u672C\u5C31\u4E0D\u662F\u90A3\u79CD\u95EE\u9898\uFF0C\u8FD9\u5C31\u5B58\u5728\u5982\u4F55\u590D\u73B0\u4E0E\u8F6C\u5316\u95EE\u9898\u7B49\uFF09</li></ol><p>\u6240\u6709\u7684\u6D4B\u8BD5\u90FD\u662F\u4FDD\u8BC1\u8F6F\u4EF6\u9AD8\u8D28\u91CF\u7684\u4EA4\u4ED8\uFF01</p>',87),c=[d];function g(_,m){return l(),a("div",null,c)}var f=i(s,[["render",g],["__file","005_test_layer.html.vue"]]);export{f as default};
